import React, { useState } from 'react';
import axios from 'axios';

const Booking = () => {
  const [formData, setFormData] = useState({
    email: '',
    startDate: '',
    endDate: '',
    mobileNumber: '',
    name: '',
    numberOfPeople: ''
  });

  const { email, startDate, endDate, mobileNumber, name, numberOfPeople} = formData;

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleFileChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.files[0] });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const formDataToSend = new FormData();
      formDataToSend.append('email', email);
      formDataToSend.append('startDate', startDate);
      formDataToSend.append('endDate', endDate);
      formDataToSend.append('mobileNumber', mobileNumber);
      formDataToSend.append('name', name);
      formDataToSend.append('numberOfPeople', numberOfPeople);

      await axios.post('http://localhost:5000/api/book/', formDataToSend);

      alert('Booking submitted successfully');
      // Reset form after successful submission
      setFormData({
        email: '',
        startDate: '',
        endDate: '',
        mobileNumber: '',
        name: '',
        numberOfPeople: ''
      });
    } catch (error) {
      console.error('Error submitting booking:', error);
      alert('Failed to submit booking');
    }
  };

  return (
    <div>
      {/* provide the booking form */}
      <div className="container">
        <div className="row">
          <div className="col-md-6">
            <form onSubmit={handleSubmit}>
              <div className="mb-3">
                <label htmlFor="exampleInputEmail1" className="form-label">Email address</label>
                <input type="email" className="form-control" name="email" value={email} onChange={handleChange} aria-describedby="emailHelp"/>
                <div id="emailHelp" className="form-text">We'll never share your email with anyone else.</div>
              </div>
              {/* add start date , end date and mob number,name,no of people  */}
              <div className="mb-3">
                <label htmlFor="exampleInputStartDate" className="form-label">Start Date</label>
                <input type="date" className="form-control" name="startDate" value={startDate} onChange={handleChange} aria-describedby="emailHelp"/>
              </div>
              <div className="mb-3">
                <label htmlFor="exampleInputEndDate" className="form-label">End Date</label>
                <input type="date" className="form-control" name="endDate" value={endDate} onChange={handleChange} aria-describedby="emailHelp"/>
              </div>
              <div className="mb-3">
                <label htmlFor="exampleInputMobileNumber" className="form-label">Mobile Number</label>
                <input type="number" className="form-control" name="mobileNumber" value={mobileNumber} onChange={handleChange} aria-describedby="emailHelp"/>
              </div>
              <div className="mb-3">
                <label htmlFor="exampleInputName" className="form-label">Name</label>
                <input type="text" className="form-control" name="name" value={name} onChange={handleChange} aria-describedby="emailHelp"/>
              </div>
              <div className="mb-3">
                <label htmlFor="exampleInputNumberOfPeople" className="form-label">No of People</label>
                <input type="number" className="form-control" name="numberOfPeople" value={numberOfPeople} onChange={handleChange} aria-describedby="emailHelp"/>
              </div>
              <div className="mb-3">
                <label htmlFor="exampleInputIdProof" className="form-label">ID Proof</label>
                <input type="file" className="form-control" name="idProof" onChange={handleFileChange} aria-describedby="emailHelp"/>
              </div>
              <div className="mb-3">
                <label htmlFor="exampleInputAddressProof" className="form-label">Address Proof</label>
                <input type="file" className="form-control" name="addressProof" onChange={handleFileChange} aria-describedby="emailHelp"/>
              </div>
              <button type="submit" className="btn btn-primary">Pay Now</button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Booking;
